import React from "react";

let cartMovies = () => {
    return (
        <div className="wrapper">
            <div className="cart">
                <div className="img">
                    <img src="../images/moviesImg.jpg"/>
                </div>
            </div>
        </div>
    )
}

export default cartMovies
